ata-image-src=\"themes/custom/tbdtheme/assets/dist/img/template/Rectangle_591.png\" style=\"background-image: url(&quot;themes/custom/tbdtheme/assets/dist/img/template/Rectangle_591.png&quot;);\">\n      <div class=\"container pt-18 pb-18 text-center\">\n        <div class=\"row\">\n          <div class=\"mx-auto\">\n            <h1 class=\"display-2 mb-3\">Expand Social Protection in Asia and the Pacific</h1>\n            <p class=\"lead fs-lg px-5 px-md-21\">The Social Protection Toolbox is a platform providing support for policymakers to build inclusive social protection systems.</p>\n          </div>\n        </div>\n      </div>\n    </section>\n    <section class=\"wrapper\">\n      <div class=\"container\">\n        <div class=\"row justify-content-md-center text-center\">\n          <div class=\"col col-lg-6\">\n            <div class=\"card shadow-lg bg-orange text-white\">\n              <div class=\"card-body\">\n                <img src=\"themes/custom/tbdtheme/assets/dist/img/icons/light-bulb.svg\" class=\"svg-inject icon-svg icon-svg-md mb-3\" alt=\"\" />\n                <h4 class=\"text-white\">E-learning Platform</h4>\n                <p class=\"mb-2\">Interactive online service that provides learners with information and resources to enhance educational delivery.</p>\n                <a href=\"#\" class=\"more hover link-white\">Learn More</a>\n              </div>\n            </div>\n          </div>\n          <div class=\"col col-lg-6 \">\n            <div class=\"card shadow-lg bg-blue text-white\">\n              <div class=\"card-body\">\n                <img src=\"themes/custom/tbdtheme/assets/dist/img/icons/settings-3.svg\" class=\"svg-inject icon-svg icon-svg-md mb-3\" alt=\"\" />\n                <h4 class=\"text-white\">Simulation tool</h4>\n                <p class=\"mb-2\">Support for a single or bulk upload. Strictly prohibit from uploading company data or other band files.</p>\n                <a href=\"#\" class=\"more hover link-white\">Learn More</a>\n              </div>\n            </div>\n          </div>\n        </div>\n    </section>\n    <section class=\"wrapper text-center py-1\">\n      <div class=\"container py-0 py-md-16\">\n        <div class=\"row\">\n          <div class=\"col-lg-6 col-xl-10 mx-auto\">\n            <img src=\"themes/custom/tbdtheme/assets/dist/img/icons/puzzle-2.svg\" class=\"svg-inject icon-svg icon-svg-md mb-4\" alt=\"\" />\n            <h2 class=\"display-4 mb-3 text-center\">What is social protection?</h2>\n            <p class=\"lead mb-5 px-md-16 px-lg-3\">Social protection is a human right. It is a set of policies to help women, men and children reach or maintain an adequate standard of living and good health. Building social protection systems, including social protection floors, is at the forefront of the 2030 Agenda for Sustainable Development because they reduce and prevent poverty and level out inequalities.</p>\n          </div>\n          <div class=\"col-lg-6 col-xl-10 mx-auto\">\n            <a href=\"#\" class=\"more hover\">Learn More</a>\n          </div>\n        </div>\n      </div>\n    </section>\n    <section class=\"wrapper image-wrapper bg-image bg-overlay bg-orange text-white\" data-image-src=\"themes/custom/tbdtheme/assets/dist/img/template/Rectangle_593.png\">\n      <div class=\"container pt-md-16 pb-md-20 text-center\">\n        <div class=\"row\">\n          <div class=\"col-md-10 col-lg-8 mx-auto\">\n            <h1 class=\"display-1 text-white mb-3\">Learn with us</h1>\n            <p class=\"lead fs-lg px-md-3 px-lg-7 px-xl-9 px-xxl-10\">Increase your knowledge in the field of social protection.</p>\n          </div>\n        </div>\n      </div>\n    </section>\n    <section>\n      <div class=\"container\">\n        <div class=\"row gx-md-5 gy-5 text-center\" style=\"top: -120px; position: relative;\">\n          <div class=\"col-md-4\">\n            <div class=\"card shadow-lg\">\n              <div class=\"card-body\">\n